import React from 'react'
import './Nav.css'
import {NavLink} from 'react-router-dom'

const Nav=()=>{
    function click(){
        var x=document.getElementById('form')
        if(x.style.display==='none'){
          x.style.display='block'
         
        }
           else{
          x.style.display='none'
        }
       }
    return(
        <>
        <section className='navbar'>
            <div className='navbar1'>
                <a>HariCharan</a>
            </div>
            <div className='navbar2'>
            <NavLink href to='/' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Home</NavLink>
<NavLink href to='/About' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>About</NavLink>
<NavLink to='/Service' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Service</NavLink>

            </div>
          <div className='navbar3'>
        <button onClick={click}>Login/Signup</button>
            </div>
          
        </section>
        
       </> 
          
    );
}
export default Nav;
